import logo from './logo.svg';
import './App.css';

function App() {
  return (
    function calculate(a, b) {
      const add = a + b;
      const subtract = a - b;
      const multiply = a * b;
      const divide = a / b;

      return [add, subtract, multiply, divide];
    }

    // 
  );
}

export default App;
